My Dad's Hot Girlfriend  Allanah Li

Actors: Allanah Li, Bill Bailey

Release Date: December 06, 2010

Who: Dad's Girlfriend,

Where: Couch, Living room,

Allanah Li is a hot personal trainer at Bill's gym, and it's a dream come true that she's at his front door. That is, until he finds out she's there to see his father. Bill thinks she's more his speed, but to Allanah, age is just a number. Good thing he's a chip off the old block, because she thinks he's kind of cute too. At the end of the day, she came over for a work out, and equipment is equipment. In Bill's case, the nut doesn't fall far from the tree, and who wouldn't want to nut on this healthy babe?
